func increasingTriplet(nums []int) bool {
	m1, m2 := math.MaxInt, math.MaxInt
	for _, i := range nums {
		if i <= m1 {
			m1 = i
		} else if i <= m2 {
			m2 = i
		} else {
			return true
		}
	}
	return false
}

